import React, { Component } from 'react';

class RecipeSearchButtons extends Component {
    render() {
        const {searchRecipesByRate} = this.props
        return (
            <>
                <button className="btn btn-success mr-3" onChange={searchRecipesByRate}>Best Recipes</button>
                <button className="btn btn-danger" onChange={searchRecipesByRate}>Worst Recipes</button>
            </>
        );
    }
}

export default RecipeSearchButtons;
